import React from 'react';
import './PropertyItem.css';
import StarRatings from 'react-star-ratings';

const PropertyItem = ({ id, location, title, price, rating }) => {
	return (
		<div className='property'>
			{/* <img
				alt='robots'
				src={`https://robohash.org/${id}?100x100`}
			/> */}
			<div>
				<h3> {location} </h3>
				<h2> {title} </h2>
				<p> {`$ ${price} CAD/night`}</p>
				<div className='stars'>
					<StarRatings
						rating={rating}
						starRatedColor='#00A699'
						numberOfStars={5}
						name='rating'
					/>
				</div>
			</div>
		</div>
	);
};

export default PropertyItem;
